('04ecfecd-c523-4b0f-81ec-ceb1f3ce9e4a', 'c8514ae7-f603-415e-8603-039515f7189e', 'Magandang umaga. Ubos na ang corn silage sa buong Lucena area. Lahat ng suppliers wala nang stock. Tumaas din ng 30 pesos per kilo ang concentrated feeds. Hindi ko na kaya bayaran. May 12 akong baka na nagugutom. Kailangan urgent ng tulong.', 'Farmer reports critical feed shortage in Lucena area affecting 12 cattle. Corn silage completely unavailable from all suppliers. Concentrated feed prices increased by ₱30/kg, making it unaffordable. Urgent assistance needed to prevent animal starvation.', 'feed_shortage', ARRAY['financial_assistance']::feedback_category[], 'urgent', 95, 'critical', '{"location": ["Lucena"], "livestock_type": ["cattle"], "feed_types": ["corn silage", "concentrated feeds"], "quantity": 12, "price_increase": "30 pesos/kg"}'::jsonb, 'acknowledged', '{"total_animals": 12, "active_animals": 12, "farm_size": "medium", "primary_livestock": "cattle", "recent_health_issues": 0}'::jsonb, '2025-08-02 07:15:00+08', ARRAY['feed-shortage', 'urgent', 'quezon', 'corn-silage'], 'Feeds and Feeding Division', NULL, NULL, NULL),
('abadb3a9-8342-4862-bb0a-f18b1a551624', 'c8514ae7-f603-415e-8603-039515f7189e', 'Ang kalabaw ko ay may lagnat at hindi kumakain ng tatlong araw na. Mainit ang katawan at lumuluha ang mata. May sakit ba ito? Kailangan ko ng veterinarian na makapunta dito sa farm.', 'Carabao showing fever symptoms for 3 days, refusing to eat, with hot body temperature and watery eyes. Farmer requests on-site veterinary consultation.', 'veterinary_support', NULL, 'negative', 72, 'high', '{"location": ["Lipa City"], "livestock_type": ["carabao"], "symptoms": ["fever", "anorexia", "lacrimation"], "duration": "3 days"}'::jsonb, 'action_taken', '{"total_animals": 8, "active_animals": 7, "farm_size": "small", "primary_livestock": "carabao", "recent_health_issues": 1}'::jsonb, '2025-08-03 09:30:00+08', ARRAY['veterinary', 'fever', 'carabao'], 'Bureau of Animal Industry (BAI)', 'Mobile vet dispatched Aug 4. Diagnosed heat stress and mild infection. Treatment provided.', NULL, NULL),
('ac882771-5691-47ad-9be9-0faf21a14ec2', 'c8514ae7-f603-415e-8603-039515f7189e', 'Tatlo sa aming mga dairy cows ay may namumula at namamagang udder. May mainit na sugat at bumaba ang milk production ng halos 50%. Natatakot kami na mastitis ito at baka kumalat.', 'Three dairy cows showing mastitis symptoms: inflamed, reddened udders with hot lesions. Milk production dropped 50%. Farmer concerned about disease spread.', 'disease_outbreak', NULL, 'urgent', 88, 'critical', '{"location": ["Bay", "Laguna"], "livestock_type": ["dairy cows"], "disease": ["mastitis"], "affected_count": 3, "production_impact": "50% decrease"}'::jsonb, 'under_review', '{"total_animals": 15, "active_animals": 15, "farm_size": "medium", "primary_livestock": "cattle", "monthly_milk_production_avg": 850.0, "recent_health_issues": 3}'::jsonb, '2025-08-05 14:20:00+08', ARRAY['mastitis', 'disease-outbreak', 'laguna', 'critical'], 'Disease Control Division', NULL, NULL, NULL),
('374c6d04-f0a5-42ec-ab63-ef217f24d2d7', 'c8514ae7-f603-415e-8603-039515f7189e', 'Wala na ring corn silage dito sa Tiaong. Lahat ng tindahan sold out. Ang presyo ng hay tumaas mula 180 to 250 per bale. Kailangan ng subsidized feeds o koneksyon sa mas murang supplier.', 'Corn silage completely sold out in Tiaong. Hay prices increased from ₱180 to ₱250 per bale. Requesting subsidized feeds or affordable supplier connections.', 'feed_shortage', NULL, 'negative', 78, 'high', '{"location": ["Tiaong", "Quezon"], "livestock_type": ["cattle"], "feed_types": ["corn silage", "hay"], "price_increase": "180 to 250 per bale"}'::jsonb, 'acknowledged', '{"total_animals": 10, "active_animals": 10, "farm_size": "small", "primary_livestock": "cattle", "recent_health_issues": 0}'::jsonb, '2025-08-07 11:45:00+08', ARRAY['feed-shortage', 'quezon', 'price-increase'], 'Feeds and Feeding Division', NULL, NULL, NULL),
('27ed4579-d87f-4229-80ad-fb433584c15c', 'c8514ae7-f603-415e-8603-039515f7189e', 'Mahirap magbenta ng fresh milk dito sa Calamba. Walang dairy processor na bumibili directly. Napilitan ibenta sa middleman 30 pesos per liter. Sa market 65 pesos. Pwede matulungan makakonekta sa buyers?', 'Farmer struggling to sell fresh milk in Calamba due to lack of direct dairy processor access. Forced to sell to middlemen at ₱30/L vs market price ₱65/L.', 'market_access', NULL, 'negative', 55, 'medium', '{"location": ["Calamba", "Laguna"], "product": ["fresh milk"], "price_gap": "30 vs 65 pesos/liter", "issue": ["middleman", "market linkage"]}'::jsonb, 'submitted', '{"total_animals": 18, "active_animals": 18, "farm_size": "medium", "primary_livestock": "cattle", "monthly_milk_production_avg": 1200.0}'::jsonb, '2025-08-09 16:30:00+08', ARRAY['market-access', 'dairy', 'pricing'], 'Marketing Assistance Division', NULL, NULL, NULL),
('b1f0b63b-9740-4776-8660-721d427936f3', 'c8514ae7-f603-415e-8603-039515f7189e', 'Gusto ko matuto ng artificial insemination para sa mga baka. Mahal ang technician fee. Kung matututo ako, mas makakatipid at mabilis ang breeding program. May training ba?', 'Farmer wants to learn artificial insemination for cattle to reduce technician fees and improve breeding program efficiency.', 'training_request', NULL, 'neutral', 45, 'medium', '{"location": ["Los Baños"], "training_topic": ["artificial insemination"], "motivation": ["cost reduction", "breeding efficiency"]}'::jsonb, 'submitted', '{"total_animals": 12, "active_animals": 12, "farm_size": "small", "primary_livestock": "cattle"}'::jsonb, '2025-08-10 10:15:00+08', ARRAY['training', 'ai-breeding', 'capacity'], 'Extension Services', NULL, NULL, NULL),
('374c6d04-f0a5-42ec-ab63-ef217f24d2d7', 'c8514ae7-f603-415e-8603-039515f7189e', 'Pareho sa Tayabas, wala na ring corn silage. Naghahanap ng alternative feeds. May alam ba sources o paano gumawa ng own silage? Kailangan training sa feed formulation.', 'Corn silage shortage in Tayabas. Farmer seeking alternative feed sources or training on homemade silage production and feed formulation.', 'feed_shortage', ARRAY['training_request']::feedback_category[], 'negative', 68, 'high', '{"location": ["Tayabas", "Quezon"], "needs": ["alternative feeds", "silage training", "feed formulation"]}'::jsonb, 'acknowledged', '{"total_animals": 14, "active_animals": 14, "farm_size": "medium", "primary_livestock": "cattle"}'::jsonb, '2025-08-12 13:50:00+08', ARRAY['feed-shortage', 'quezon', 'training'], 'Feeds and Feeding Division', NULL, NULL, NULL),
('71e6b7e0-c6d2-4519-81a4-b575e97c4200', 'c8514ae7-f603-415e-8603-039515f7189e', 'Ang daming requirements para sa livestock registration. Mahirap ang proseso at matagal. Pwede gawing mas simple? Maraming small farmers hindi naka-register dahil sa komplikado.', 'Complicated livestock registration process with too many requirements. Many small farmers unable to register. Requesting simplified system.', 'policy_concern', NULL, 'neutral', 38, 'low', '{"issue": ["registration requirements", "process complexity"], "affected_group": ["small farmers"]}'::jsonb, 'resolved', '{"total_animals": 6, "active_animals": 6, "farm_size": "small", "primary_livestock": "cattle"}'::jsonb, '2025-08-14 08:25:00+08', ARRAY['policy', 'registration', 'bureaucracy'], 'Regulatory Affairs', NULL, 'Feedback forwarded to policy team. New simplified registration system under development.', '2025-09-20'),
('c6e17279-4418-4e2f-bf23-2822d89c3632', 'c8514ae7-f603-415e-8603-039515f7189e', 'Walang farm-to-market road sa Rodriguez. Mahirap mag-transport ng gatas at hayop. Kapag umuulan, hindi passable ang daan. Kailangan ng concreted road o gravel.', 'No farm-to-market road in Rodriguez area. Difficult to transport milk and livestock. Road impassable during rain. Requesting road construction.', 'infrastructure', NULL, 'negative', 52, 'medium', '{"location": ["Rodriguez"], "infrastructure_type": ["farm-to-market road"], "products_affected": ["milk", "livestock"], "severity": "impassable during rain"}'::jsonb, 'submitted', '{"total_animals": 9, "active_animals": 9, "farm_size": "small", "primary_livestock": "cattle"}'::jsonb, '2025-08-15 15:40:00+08', ARRAY['infrastructure', 'road', 'transport'], 'Agricultural Engineering', NULL, NULL, NULL),
('3a57a62d-55af-43b7-93d0-0cb45b897754', 'c8514ae7-f603-415e-8603-039515f7189e', 'May lump ang baka ko sa leeg na lumalaki. Parang may bukol. Hindi nahihirapan huminga pero nag-aalala ako. Pwede magpatingin sa veterinarian? Ano kaya ito?', 'Cow has growing lump/mass on neck. No breathing difficulty but farmer concerned. Requesting veterinary examination for diagnosis.', 'veterinary_support', NULL, 'negative', 65, 'high', '{"location": ["Santo Tomas"], "livestock_type": ["cattle"], "symptoms": ["neck lump", "mass growth"], "urgency": "moderate"}'::jsonb, 'under_review', '{"total_animals": 11, "active_animals": 11, "farm_size": "medium", "primary_livestock": "cattle", "recent_health_issues": 1}'::jsonb, '2025-08-17 09:10:00+08', ARRAY['veterinary', 'tumor', 'cattle'], 'Bureau of Animal Industry (BAI)', NULL, NULL, NULL),
