('27ed4579-d87f-4229-80ad-fb433584c15c', 'c8514ae7-f603-415e-8603-039515f7189e', 'May dalawang baka na ang udder ay namamaga at mainit. Bumaba gatas kalahati. Parang pareho ng sa Bay. Mastitis ba ito? Ano gagawin?', 'Two cows with inflamed, hot udders. Milk production reduced by half. Similar to Bay cases. Possible mastitis outbreak.', 'disease_outbreak', NULL, 'urgent', 85, 'critical', '{"location": ["Calamba", "Laguna"], "livestock_type": ["dairy cattle"], "disease": ["mastitis"], "affected_count": 2, "production_impact": "50% decrease", "pattern": "similar to Bay"}'::jsonb, 'acknowledged', '{"total_animals": 18, "active_animals": 16, "farm_size": "medium", "primary_livestock": "cattle", "monthly_milk_production_avg": 950.0, "recent_health_issues": 2}'::jsonb, '2025-08-20 07:30:00+08', ARRAY['mastitis', 'disease-outbreak', 'laguna', 'critical'], 'Disease Control Division', NULL, NULL, NULL),
('04ecfecd-c523-4b0f-81ec-ceb1f3ce9e4a', 'c8514ae7-f603-415e-8603-039515f7189e', 'Dalawang linggo na walang corn silage sa Lucena. Mga baka pumapayat na. Kailangan urgent ng alternative feeds o subsidy. Hindi na kayang bumili ng mahal.', 'No corn silage in Lucena for 2 weeks. Cattle losing weight. Urgent need for alternative feeds or subsidies. Unable to afford expensive feeds.', 'feed_shortage', ARRAY['financial_assistance']::feedback_category[], 'urgent', 92, 'critical', '{"location": ["Lucena", "Quezon"], "livestock_type": ["cattle"], "duration": "2 weeks", "impact": "weight loss", "urgency": "critical"}'::jsonb, 'action_taken', '{"total_animals": 12, "active_animals": 12, "farm_size": "medium", "primary_livestock": "cattle"}'::jsonb, '2025-08-22 13:45:00+08', ARRAY['feed-shortage', 'quezon', 'critical', 'weight-loss'], 'Feeds and Feeding Division', 'Emergency feed distribution coordinated. 500kg corn silage delivered Aug 24.', NULL, NULL),
