('71a00f26-ac07-4edf-988e-ab8d4b7d610b', 'c8514ae7-f603-415e-8603-039515f7189e', 'Gusto matuto ng proper silage making. Nakita sa internet pero hindi sure kung tama. May hands-on training ba? Importante para sa feed security.', 'Wants to learn proper silage making. Saw online information but unsure of accuracy. Requesting hands-on training for feed security.', 'training_request', NULL, 'positive', 44, 'medium', '{"training_topic": ["silage making"], "training_type": ["hands-on"], "motivation": ["feed security", "self-sufficiency"]}'::jsonb, 'submitted', '{"total_animals": 9, "active_animals": 9, "farm_size": "small", "primary_livestock": "cattle"}'::jsonb, '2025-08-26 09:30:00+08', ARRAY['training', 'silage', 'feed-security'], 'Extension Services', NULL, NULL, NULL),
