('540e1404-c8da-46d5-b9a5-ad7eae6b8b7d', 'c8514ae7-f603-415e-8603-039515f7189e', 'May bagong animal welfare policy ba? Paano magiging compliant? Kailangan ba ng inspection? Ano ang penalties kung hindi sumunod?', 'Inquiring about new animal welfare policy. Questions on compliance requirements, inspection procedures, and penalties for non-compliance.', 'policy_concern', NULL, 'neutral', 32, 'low', '{"policy_type": ["animal welfare"], "concerns": ["compliance", "inspection", "penalties"]}'::jsonb, 'submitted', '{"total_animals": 5, "active_animals": 5, "farm_size": "small", "primary_livestock": "cattle"}'::jsonb, '2025-08-28 11:10:00+08', ARRAY['policy', 'animal-welfare', 'compliance'], 'Regulatory Affairs', NULL, NULL, NULL),
